import { Option } from './Option'; 

import { Contrat } from './Contrat';  // Importer le modèle Contrat

export class Etudiant {
  idEtudiant!: number;
  prenomE!: string;
  nomE!: string;
  op!: string;  // Vous pouvez ajuster cela pour utiliser l'énumération ou des chaînes de caractères fixes.
  contrats!: Contrat[];  // Ajout de la liste des contrats associés à l'étudiant
}
